@dataclass
class OcrFeatureNode: # or Mode Node?
    """A node representation for a Spark OCR Annotator
    Used to cast the pipeline dependency resolution algorithm into an abstract grpah
    """
    # TODO quickfix str remove
    node : Union[OCR_ANNO,str] # JSL Annotator that can generate this Triplet. Could be from OCR/JSL-Internal/Spark-NLP
    ins  : List[Union[JslFeature, OCR_FEATURE, str]] # JSL Annotator that can generate this Triplet
    outs : List[Union[JslFeature, OCR_FEATURE, str]] # JSL Annotator that can generate this Triplet
