@dataclass
class OCR_NODES: # or Mode Node?
    """All avaiable Feature nodes in OCR
    Used to cast the pipeline dependency resolution algorithm into an abstract grpah
    """

    # Visual Document Understanding
    VISUAL_DOCUMENT_CLASSIFIER = OcrFeatureNode(OCR_ANNO.VISUAL_DOCUMENT_CLASSIFIER, [OCR_FEATURE.HOCR, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.PREDICTION_TEXT_TABLE, OCR_FEATURE.PREDICTION_CONFIDENCE])
    # VISUAL_DOCUMENT_NER = OcrFeatureNode(OCR_ANNO.VISUAL_DOCUMENT_NER, [OcrFeature.HOCR, OcrFeature.FILE_PATH], [NlpFeature.NER_Annotation]) # TODO NlpFeature Space!

    # Object Detection
    IMAGE_HANDWRITTEN_DETECTOR = OcrFeatureNode(OCR_ANNO.IMAGE_HANDWRITTEN_DETECTOR, [OCR_FEATURE.OCR_IMAGE, ], [OCR_FEATURE.OCR_REGION])

    # TABLE Processors/Recognition TODO REGION==CELL>??
    IMAGE_TABLE_DETECTOR = OcrFeatureNode(OCR_ANNO.IMAGE_TABLE_DETECTOR, [OCR_FEATURE.OCR_IMAGE, ], [OCR_FEATURE.OCR_TABLE]) #TODO REGION or TABLE??? IS IT THE SAME???
    IMAGE_TABLE_CELL_DETECTOR = OcrFeatureNode(OCR_ANNO.IMAGE_TABLE_CELL_DETECTOR, [OCR_FEATURE.OCR_IMAGE, ], [OCR_FEATURE.OCR_TABLE_CELLS]) #TODO REGION or TABLE??? IS IT THE SAME???
    IMAGE_TABLE_CELL2TEXT_TABLE = OcrFeatureNode(OCR_ANNO.IMAGE_TABLE_CELL2TEXT_TABLE, [OCR_FEATURE.OCR_IMAGE, OCR_FEATURE.OCR_TABLE_CELLS], [OCR_FEATURE.OCR_TABLE]) #TODO OUPUT!! REGION or TABLE??? IS IT THE SAME???

    # TODO are POSITIOns  and REGIONS the same??? Regions is an ARRAY of PSOTISIONS. BUT is REGION=== TABLE??? Samefor CELLs
    #PDF Processing
    PDF2TEXT = OcrFeatureNode(OCR_ANNO.PDF2TEXT, [OCR_FEATURE.BINARY_PDF, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.TEXT, OCR_FEATURE.PAGE_NUM])
    PDF2IMAGE = OcrFeatureNode(OCR_ANNO.PDF2IMAGE, [OCR_FEATURE.BINARY_PDF, OCR_FEATURE.FILE_PATH, OCR_FEATURE.FALL_BACK], [OCR_FEATURE.OCR_IMAGE, OCR_FEATURE.PAGE_NUM])
    IMAGE2PDF = OcrFeatureNode(OCR_ANNO.IMAGE2PDF, [OCR_FEATURE.OCR_IMAGE, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.BINARY_PDF])
    TEXT2PDF = OcrFeatureNode(OCR_ANNO.TEXT2PDF, [OCR_FEATURE.OCR_POSITIONS, OCR_FEATURE.OCR_IMAGE, OCR_FEATURE.OCR_TEXT, OCR_FEATURE.FILE_PATH, OCR_FEATURE.BINARY_PDF], [OCR_FEATURE.BINARY_PDF])
    PDF_ASSEMBLER = OcrFeatureNode(OCR_ANNO.PDF_ASSEMBLER, [OCR_FEATURE.BINARY_PDF_PAGE, OCR_FEATURE.FILE_PATH, OCR_FEATURE.PAGE_NUM], [OCR_FEATURE.BINARY_PDF])
    PDF_DRAW_REGIONS = OcrFeatureNode(OCR_ANNO.PDF_DRAW_REGIONS, [OCR_FEATURE.BINARY_PDF, OCR_FEATURE.FILE_PATH, OCR_FEATURE.OCR_POSITIONS], [OCR_FEATURE.BINARY_PDF])
    PDF2TEXT_TABLE = OcrFeatureNode(OCR_ANNO.PDF2TEXT_TABLE, [OCR_FEATURE.BINARY_PDF, OCR_FEATURE.FILE_PATH, ], [OCR_FEATURE.OCR_TABLE])

    # DOCX Processing
    DOC2TEXT = OcrFeatureNode(OCR_ANNO.DOC2TEXT, [OCR_FEATURE.BINARY_DOCX, OCR_FEATURE.FILE_PATH, ], [OCR_FEATURE.TEXT, OCR_FEATURE.PAGE_NUM])
    DOC2TEXT_TABLE = OcrFeatureNode(OCR_ANNO.DOC2TEXT_TABLE, [OCR_FEATURE.BINARY_DOCX, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.OCR_TABLE])
    DOC2PDF = OcrFeatureNode(OCR_ANNO.DOC2PDF, [OCR_FEATURE.BINARY_DOCX, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.BINARY_PDF])
    PPT2TEXT_TABLE = OcrFeatureNode(OCR_ANNO.PPT2TEXT_TABLE, [OCR_FEATURE.BINARY_PPT, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.OCR_TABLE])
    PPT2PDF = OcrFeatureNode(OCR_ANNO.PPT2PDF, [OCR_FEATURE.BINARY_PPT, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.BINARY_PDF])

    # DICOM Processing
    DICOM2IMAGE = OcrFeatureNode(OCR_ANNO.DICOM2IMAGE, [OCR_FEATURE.BINARY_DICOM, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.OCR_IMAGE, OCR_FEATURE.PAGE_NUM, OCR_FEATURE.DICOM_METADATA])
    IMAGE2DICOM = OcrFeatureNode(OCR_ANNO.IMAGE2DICOM, [OCR_FEATURE.OCR_IMAGE, OCR_FEATURE.FILE_PATH, OCR_FEATURE.DICOM_METADATA], [OCR_FEATURE.BINARY_DICOM])

    # Image Pre-Processing
    BINARY2IMAGE = OcrFeatureNode(OCR_ANNO.BINARY2IMAGE, [OCR_FEATURE.BINARY_IMG, OCR_FEATURE.FILE_PATH], [OCR_FEATURE.OCR_IMAGE])
    GPU_IMAGE_TRANSFORMER = OcrFeatureNode(OCR_ANNO.GPU_IMAGE_TRANSFORMER, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE])

    IMAGE_BINARIZER = OcrFeatureNode(OCR_ANNO.IMAGE_BINARIZER, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE])
    IMAGE_ADAPTIVE_BINARIZER = OcrFeatureNode(OCR_ANNO.IMAGE_ADAPTIVE_BINARIZER, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE])
    IMAGE_ADAPTIVE_THRESHOLDING = OcrFeatureNode(OCR_ANNO.IMAGE_ADAPTIVE_THRESHOLDING, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE])
    IMAGE_SCALER = OcrFeatureNode(OCR_ANNO.IMAGE_SCALER, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE])
    IMAGE_ADAPTIVE_SCALER = OcrFeatureNode(OCR_ANNO.IMAGE_ADAPTIVE_SCALER, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE])
    IMAGE_SKEW_CORRECTOR = OcrFeatureNode(OCR_ANNO.IMAGE_SKEW_CORRECTOR, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE])

    # TODO THESE ALL BLOW??? Region???
    IMAGE_NOISE_SCORER = OcrFeatureNode(OCR_ANNO.IMAGE_NOISE_SCORER, [OCR_FEATURE.OCR_IMAGE, OCR_FEATURE.OCR_REGION], [OCR_FEATURE.OCR_IMAGE]) # TODO WHAT IS REGION???? There is no schema for that
    IMAGE_REMOVE_OBJECTS = OcrFeatureNode(OCR_ANNO.IMAGE_REMOVE_OBJECTS, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE]) # TODO
    IMAGE_MORPHOLOGY_OPERATION = OcrFeatureNode(OCR_ANNO.IMAGE_MORPHOLOGY_OPERATION, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE]) # TODO
    IMAGE_CROPPER = OcrFeatureNode(OCR_ANNO.IMAGE_CROPPER, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE]) # TODO
    IMAGE2REGION = OcrFeatureNode(OCR_ANNO.IMAGE2PDF, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE]) # TODO
    IMAGE_LAYOUT_ANALZYER = OcrFeatureNode(OCR_ANNO.IMAGE_LAYOUT_ANALZYER, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE]) # TODO
    IMAGE_SPLIT_REGIONS = OcrFeatureNode(OCR_ANNO.IMAGE_SPLIT_REGIONS, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE]) # TODO
    IMAGE_DRAW_REGIONS = OcrFeatureNode(OCR_ANNO.IMAGE_DRAW_REGIONS, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_IMAGE]) # TODO

    # Character Recognition .. TODO these should be correct but not 100% sure about the positions
