    IMAGE2TEXTPDF = OcrFeatureNode(OCR_ANNO.IMAGE2TEXTPDF, [OCR_FEATURE.OCR_IMAGE, OCR_FEATURE.FILE_PATH, OCR_FEATURE.PAGE_NUM], [OCR_FEATURE.BINARY_PDF]) # TODO is output just normal binary PDF? Not 100% sure
    IMAGE2HOCR = OcrFeatureNode(OCR_ANNO.IMAGE2HOCR, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.HOCR]) # TODO is ouput HOCR format as in HOCR_DOCUMENT_ASSAMBLER???
    IMAGE_BRANDS2TEXT = OcrFeatureNode(OCR_ANNO.IMAGE_BRANDS2TEXT, [OCR_FEATURE.OCR_IMAGE], [OCR_FEATURE.OCR_POSITIONS, OCR_FEATURE.TEXT, OCR_FEATURE.OCR_IMAGE]) # TODO what is the STRUCTURE of output image_brand ??? OCR_IE??

